import React from 'react';
import { Link } from 'react-router-dom';
import {useNavigate} from 'react-router-dom'

const Nav = () => {
  const navigate = useNavigate();

  const auth = localStorage.getItem("userInfo");
  const loginUser = localStorage.getItem("user");
  const logout = ()=>{
    localStorage.clear();
    navigate('/signup');
  }
  return (
    <div>
      <ul className='nav-ul'>
        <li>
        <Link to={"/"}>Prodcuts</Link>

        </li>
        <li>
        <Link to={"/add"}>Add prodcut</Link>

        </li>
        <li>
        <Link to={"/update"}>Update prodcut</Link>

        </li>
        <li>
        <Link to={"/profile"}>Profile</Link>

        </li>
        <li> {loginUser ? <Link to={"/"}>Login</Link> : <Link to={"/login"}>Login</Link>}

        </li>

        <li> {auth ? <Link onClick={logout} to={"/signup"}>Logout</Link> : <Link  to={"/signup"}>Register</Link>}

        </li>

      </ul>
    </div>
  );
};

export default Nav;
